  render() {
    const ulStyles={ 
      marginTop:"0px",
      display: "flex",
      justifyContent: "space-around"
    };
    const liStyle={
      listStyle: "none"
    }; 
    return (
      <div className="sidebar">
      <nav>
        <ul style={ulStyles}>
          <li style={liStyle}>
            History
          </li>
          <li style={liStyle}>
            Collection
          </li>
        </ul>
      </nav>
    </div>
      );
  }
}
 
export default Sidebar;
